import collections
from typing import List


class Solution:
    def maxDistance(self, grid: List[List[int]]) -> int:
        n = len(grid)
        a = collections.deque()
        # 所有陆地入队
        for i in range(n):
            for j in range(n):
                if grid[i][j]==1:
                    a.append((i,j,0))
        # 在曼哈顿距离下，入队只能是以距离为1 扩散，直到遍历完整个数组
        ans = -1
        while a:
            x, y, ans = a.popleft()
            for ii, jj in zip((x, x - 1, x, x + 1), (y - 1, y, y + 1, y)):
                if 0 <= ii < n and 0 <= jj < n and grid[ii][jj]==0:
                    grid[ii][jj] = 1
                    a.append((ii,jj, ans+1))

        return -1 if ans<=0 else ans



